(393, 'a:3:{s:8:"username";s:3:"P03";s:8:"is_admin";s:1:"0";s:3:"uid";s:1:"7";}', 'a:11:{s:15:"entry_0_0_group";s:1:"7";s:15:"entry_0_1_group";s:1:"7";s:15:"entry_0_2_group";s:1:"7";s:7:"comment";s:171:"      It was not clear from the summary how much detail they went into with curves and such. The choppiness of the summary had a tendency to mask the level of explanation.";s:4:"part";s:1:"1";s:4:"cond";s:1:"3";s:4:"step";s:6:"watch2";s:4:"from";s:21:"/labeler/vs-watch.php";s:4:"vid1";s:2:"37";s:4:"vid2";s:2:"33";s:4:"vid3";s:2:"34";}', '2012-09-14 20:53:32'),
(394, 'a:3:{s:8:"username";s:3:"P03";s:8:"is_admin";s:1:"0";s:3:"uid";s:1:"7";}', 'a:11:{s:15:"entry_0_0_group";s:1:"7";s:15:"entry_0_1_group";s:1:"7";s:15:"entry_0_2_group";s:1:"7";s:7:"comment";s:76:"      The summary skipped out on some of the detailed parts of explanations.";s:4:"part";s:1:"1";s:4:"cond";s:1:"3";s:4:"step";s:6:"watch3";s:4:"from";s:21:"/labeler/vs-watch.php";s:4:"vid1";s:2:"37";s:4:"vid2";s:2:"33";s:4:"vid3";s:2:"34";}', '2012-09-14 20:55:46'),
(395, 'a:3:{s:8:"username";s:3:"P03";s:8:"is_admin";s:1:"0";s:3:"uid";s:1:"7";}', 'a:15:{s:15:"entry_0_0_group";s:1:"7";s:15:"entry_0_1_group";s:1:"5";s:15:"entry_0_2_group";s:1:"5";s:15:"entry_0_3_group";s:1:"6";s:15:"entry_0_4_group";s:1:"5";s:15:"entry_0_5_group";s:1:"7";s:15:"entry_0_6_group";s:1:"6";s:15:"entry_0_7_group";s:1:"6";s:15:"entry_0_8_group";s:1:"3";s:15:"entry_0_9_group";s:1:"6";s:7:"comment";s:366:"      In some videos, the level of assumed skill was very clear from the summary. In others it was not. This type of summary can be extremely useful, however much care must be taken to choose the right clips. If the cuts are improperly or randomly chosen, big chunks of important parts get cut out, and the summary becomes a useless montage of uninteresting actions.";s:4:"part";s:1:"1";s:4:"cond";s:1:"3";s:4:"step";s:2:"pq";s:4:"from";s:34:"/labeler/vs-post-questionnaire.php";}', '2012-09-14 20:58:03'),
