(421, 'a:3:{s:8:"username";s:3:"P05";s:8:"is_admin";s:1:"0";s:3:"uid";s:1:"9";}', 'a:11:{s:15:"entry_0_0_group";s:1:"6";s:15:"entry_0_1_group";s:1:"6";s:15:"entry_0_2_group";s:1:"6";s:7:"comment";s:214:"      While all the "steps" were listed in the summary, it was difficult to get a sense of why without the zooming into the hair, for example, to show that the refine edges was applied to make the selection better.";s:4:"part";s:1:"1";s:4:"cond";s:1:"2";s:4:"step";s:6:"watch1";s:4:"from";s:21:"/labeler/vs-watch.php";s:4:"vid1";s:2:"28";s:4:"vid2";s:2:"27";s:4:"vid3";s:2:"25";}', '2012-09-15 13:23:23'),
(422, 'a:3:{s:8:"username";s:3:"P05";s:8:"is_admin";s:1:"0";s:3:"uid";s:1:"9";}', 'a:11:{s:15:"entry_0_0_group";s:1:"6";s:15:"entry_0_1_group";s:1:"4";s:15:"entry_0_2_group";s:1:"6";s:7:"comment";s:242:"      I did not realize he was going to manually click every little point that he did. This technique seemed too laborious for me to use on most things. It was also not clear what the difference is between the pen and the polygonal lasso tool";s:4:"part";s:1:"1";s:4:"cond";s:1:"2";s:4:"step";s:6:"watch2";s:4:"from";s:21:"/labeler/vs-watch.php";s:4:"vid1";s:2:"28";s:4:"vid2";s:2:"27";s:4:"vid3";s:2:"25";}', '2012-09-15 13:30:46'),
(423, 'a:3:{s:8:"username";s:3:"P05";s:8:"is_admin";s:1:"0";s:3:"uid";s:1:"9";}', 'a:11:{s:15:"entry_0_0_group";s:1:"6";s:15:"entry_0_1_group";s:1:"5";s:15:"entry_0_2_group";s:1:"6";s:7:"comment";s:111:"This presenter is very pedantic, which I appreciate. This presentation style is lost in the summarization. \r\n\r\n";s:4:"part";s:1:"1";s:4:"cond";s:1:"2";s:4:"step";s:6:"watch3";s:4:"from";s:21:"/labeler/vs-watch.php";s:4:"vid1";s:2:"28";s:4:"vid2";s:2:"27";s:4:"vid3";s:2:"25";}', '2012-09-15 13:34:44'),
