(451, 'a:3:{s:8:"username";s:3:"P08";s:8:"is_admin";s:1:"0";s:3:"uid";s:2:"12";}', 'a:11:{s:15:"entry_0_0_group";s:1:"7";s:15:"entry_0_1_group";s:1:"7";s:15:"entry_0_2_group";s:1:"7";s:7:"comment";s:129:"      I liked that there is yellow circle around the mouse pointer as seen in its summary. The video was mostly what I expected. ";s:4:"part";s:1:"1";s:4:"cond";s:1:"1";s:4:"step";s:6:"watch1";s:4:"from";s:21:"/labeler/vs-watch.php";s:4:"vid1";s:2:"34";s:4:"vid2";s:2:"37";s:4:"vid3";s:2:"40";}', '2012-09-15 15:04:49'),
(452, 'a:3:{s:8:"username";s:3:"P08";s:8:"is_admin";s:1:"0";s:3:"uid";s:2:"12";}', 'a:11:{s:15:"entry_0_0_group";s:1:"5";s:15:"entry_0_1_group";s:1:"7";s:15:"entry_0_2_group";s:1:"5";s:7:"comment";s:394:"      The actual video had long introduction about lomo that I was not expecting from the preview. Also, putting the logo in between the introduction to the second method (using new adjustment layer) was really distracting and made me wonder why more than 1 minute is left but since there were already a long introduction in the beginning, I did not expect any useful information by that time. ";s:4:"part";s:1:"1";s:4:"cond";s:1:"1";s:4:"step";s:6:"watch2";s:4:"from";s:21:"/labeler/vs-watch.php";s:4:"vid1";s:2:"34";s:4:"vid2";s:2:"37";s:4:"vid3";s:2:"40";}', '2012-09-15 15:13:32'),
(453, 'a:3:{s:8:"username";s:3:"P08";s:8:"is_admin";s:1:"0";s:3:"uid";s:2:"12";}', 'a:11:{s:15:"entry_0_0_group";s:1:"7";s:15:"entry_0_1_group";s:1:"7";s:15:"entry_0_2_group";s:1:"7";s:7:"comment";s:380:"      The video was shorter than I thought which is good. Overall, the video was concise. One thing I did not know from the preview was that the person shows before and after setting the adjustments for each step. It does not matter when watching the full video; but while watching the preview, that was distracting - because I cannot see the progress of the picture in sequence. ";s:4:"part";s:1:"1";s:4:"cond";s:1:"1";s:4:"step";s:6:"watch3";s:4:"from";s:21:"/labeler/vs-watch.php";s:4:"vid1";s:2:"34";s:4:"vid2";s:2:"37";s:4:"vid3";s:2:"40";}', '2012-09-15 15:18:53'),
(454, 'a:3:{s:8:"username";s:3:"P08";s:8:"is_admin";s:1:"0";s:3:"uid";s:2:"12";}', 'a:15:{s:15:"entry_0_0_group";s:1:"5";s:15:"entry_0_1_group";s:1:"4";s:15:"entry_0_2_group";s:1:"4";s:15:"entry_0_3_group";s:1:"2";s:15:"entry_0_4_group";s:1:"7";s:15:"entry_0_5_group";s:1:"7";s:15:"entry_0_6_group";s:1:"7";s:15:"entry_0_7_group";s:1:"6";s:15:"entry_0_8_group";s:1:"1";s:15:"entry_0_9_group";s:1:"6";s:7:"comment";s:280:"      The strength is that I will not miss any information in the video (as oppsosed to skipping it). The weakness is that if the video contains more than 2 information (e.g. two different ways to complete a task) or if the job is not done in sequence, it becomes very confusing. ";s:4:"part";s:1:"1";s:4:"cond";s:1:"1";s:4:"step";s:2:"pq";s:4:"from";s:34:"/labeler/vs-post-questionnaire.php";}', '2012-09-15 15:23:16'),
