(564, 'a:3:{s:8:"username";s:3:"P02";s:8:"is_admin";s:1:"0";s:3:"uid";s:1:"6";}', 'a:22:{s:15:"entry_0_0_group";s:1:"4";s:15:"entry_0_1_group";s:1:"6";s:15:"entry_1_0_group";s:1:"5";s:15:"entry_1_1_group";s:1:"4";s:15:"entry_1_2_group";s:1:"6";s:15:"entry_1_3_group";s:1:"6";s:15:"entry_2_0_group";s:1:"3";s:15:"entry_2_1_group";s:1:"4";s:15:"entry_2_2_group";s:1:"3";s:15:"entry_2_3_group";s:1:"4";s:15:"entry_3_0_group";s:1:"5";s:15:"entry_3_1_group";s:1:"7";s:15:"entry_3_2_group";s:1:"7";s:15:"entry_3_3_group";s:1:"4";s:15:"entry_3_4_group";s:1:"1";s:15:"entry_3_5_group";s:1:"1";s:15:"entry_3_6_group";s:1:"2";s:7:"comment";s:158:"I''m used to seeing star ratings on videos that indicate quality. Hard to distinguish which video is better than the other (too many choices that look similar)";s:4:"part";s:1:"2";s:4:"cond";s:1:"A";s:4:"step";s:5:"postq";s:4:"from";s:18:"/labeler/postq.php";}', '2012-09-16 11:31:08'),
(570, 'a:3:{s:8:"username";s:3:"P02";s:8:"is_admin";s:1:"0";s:3:"uid";s:1:"6";}', 'a:32:{s:15:"entry_0_0_group";s:1:"4";s:15:"entry_0_1_group";s:1:"6";s:15:"entry_1_0_group";s:1:"7";s:15:"entry_1_1_group";s:1:"6";s:15:"entry_1_2_group";s:1:"7";s:15:"entry_1_3_group";s:1:"7";s:15:"entry_2_0_group";s:1:"7";s:15:"entry_2_1_group";s:1:"7";s:15:"entry_2_2_group";s:1:"7";s:15:"entry_2_3_group";s:1:"7";s:15:"entry_3_0_group";s:1:"6";s:15:"entry_3_1_group";s:1:"2";s:15:"entry_3_2_group";s:1:"7";s:15:"entry_3_3_group";s:1:"2";s:15:"entry_3_4_group";s:1:"1";s:15:"entry_3_5_group";s:1:"2";s:15:"entry_3_6_group";s:1:"7";s:15:"entry_3_7_group";s:1:"4";s:15:"entry_3_8_group";s:1:"7";s:15:"entry_3_9_group";s:1:"7";s:16:"entry_3_10_group";s:1:"7";s:16:"entry_3_11_group";s:1:"7";s:16:"entry_3_12_group";s:1:"7";s:16:"entry_3_13_group";s:1:"7";s:16:"entry_3_14_group";s:1:"7";s:16:"entry_3_15_group";s:1:"7";s:16:"entry_3_16_group";s:1:"7";s:7:"comment";s:563:"very positive experience once I understand the interface. Took a moment to realize that I needed to scroll right to see the ''end'' picture, thought it was just the video that had an incomplete output. Would be nice to see the end picture all on one screen without scrolling right on storyboard.\r\n\r\nThe interface is great, saves a lot of time and once I tried one video and didn''t work, I could quickly identify another video that used different tool so I wasn''t just repeating the same steps over and over.\r\n\r\nWould gladly use this interface over the other ones.\r\n";s:4:"part";s:1:"2";s:4:"cond";s:1:"B";s:4:"step";s:5:"postq";s:4:"from";s:18:"/labeler/postq.php";}', '2012-09-16 11:32:33'),
