(822, 'a:3:{s:8:"username";s:3:"P14";s:8:"is_admin";s:1:"0";s:3:"uid";s:2:"18";}', 'a:11:{s:15:"entry_0_0_group";s:1:"3";s:15:"entry_0_1_group";s:1:"3";s:15:"entry_0_2_group";s:1:"7";s:7:"comment";s:240:"The video summary was well understood, I could have done the job by just watching the summary. however i noticed that this video makes car look going faster by bluring out the background not blurring the car''s tail like in my original task.";s:4:"part";s:1:"1";s:4:"cond";s:1:"1";s:4:"step";s:6:"watch1";s:4:"from";s:21:"/labeler/vs-watch.php";s:4:"vid1";s:2:"10";s:4:"vid2";s:1:"6";s:4:"vid3";s:1:"8";}', '2012-09-17 20:10:54'),
(823, 'a:3:{s:8:"username";s:3:"P14";s:8:"is_admin";s:1:"0";s:3:"uid";s:2:"18";}', 'a:11:{s:15:"entry_0_0_group";s:1:"3";s:15:"entry_0_1_group";s:1:"5";s:15:"entry_0_2_group";s:1:"6";s:7:"comment";s:317:"This video''s summary was also pretty close to what the original tutorial showed. also got the wheel blurring part to look it''s rolling. One thing that looked quite irritating - not my skill level - in the summary was using the laser tool to select the car. Watching full tutorial, it seemed fine for me to do the job.";s:4:"part";s:1:"1";s:4:"cond";s:1:"1";s:4:"step";s:6:"watch2";s:4:"from";s:21:"/labeler/vs-watch.php";s:4:"vid1";s:2:"10";s:4:"vid2";s:1:"6";s:4:"vid3";s:1:"8";}', '2012-09-17 20:20:00'),
(824, 'a:3:{s:8:"username";s:3:"P14";s:8:"is_admin";s:1:"0";s:3:"uid";s:2:"18";}', 'a:11:{s:15:"entry_0_0_group";s:1:"4";s:15:"entry_0_1_group";s:1:"5";s:15:"entry_0_2_group";s:1:"6";s:7:"comment";s:268:"In summary it looked like sharpening out the car and the girl from a single blurred image. In full tutorial found out it was two layers and just erasing the blurred layer on top. Summary didn''t confused me the purpose of the task but it confused me the way how it did.";s:4:"part";s:1:"1";s:4:"cond";s:1:"1";s:4:"step";s:6:"watch3";s:4:"from";s:21:"/labeler/vs-watch.php";s:4:"vid1";s:2:"10";s:4:"vid2";s:1:"6";s:4:"vid3";s:1:"8";}', '2012-09-17 20:32:04'),
