(832, 'a:3:{s:8:"username";s:3:"P14";s:8:"is_admin";s:1:"0";s:3:"uid";s:2:"18";}', 'a:11:{s:15:"entry_0_0_group";s:1:"6";s:15:"entry_0_1_group";s:1:"6";s:15:"entry_0_2_group";s:1:"5";s:7:"comment";s:217:"It was rather similar experience. Important parts were in the summary clip. The purpose of this video was very clear in the summary as well. however clipped sounds that prevents flow of the video felt not comfortable.";s:4:"part";s:1:"1";s:4:"cond";s:1:"2";s:4:"step";s:6:"watch1";s:4:"from";s:21:"/labeler/vs-watch.php";s:4:"vid1";s:2:"22";s:4:"vid2";s:2:"23";s:4:"vid3";s:2:"29";}', '2012-09-18 01:28:18'),
(833, 'a:3:{s:8:"username";s:3:"P14";s:8:"is_admin";s:1:"0";s:3:"uid";s:2:"18";}', 'a:11:{s:15:"entry_0_0_group";s:1:"7";s:15:"entry_0_1_group";s:1:"7";s:15:"entry_0_2_group";s:1:"7";s:7:"comment";s:352:"This was better than my expectation and I think this tutorial is best suitable for my task. In summary it showed what tools were used on the menu, but the process was cut out. I could have followed the summary and figured it out by playing with it for awhile. Showing the process and just copying what exactly author does improve the confidence though.";s:4:"part";s:1:"1";s:4:"cond";s:1:"2";s:4:"step";s:6:"watch2";s:4:"from";s:21:"/labeler/vs-watch.php";s:4:"vid1";s:2:"22";s:4:"vid2";s:2:"23";s:4:"vid3";s:2:"29";}', '2012-09-18 01:54:02'),
(834, 'a:3:{s:8:"username";s:3:"P14";s:8:"is_admin";s:1:"0";s:3:"uid";s:2:"18";}', 'a:11:{s:15:"entry_0_0_group";s:1:"7";s:15:"entry_0_1_group";s:1:"5";s:15:"entry_0_2_group";s:1:"6";s:7:"comment";s:411:"Purpose of summary was pretty straight forward. Cutting out and removing white edges. This repeating process was not the important part of the video and nothing new but just showing trials and errors.. Even though I learned how to cut object precisely, I think I might have done it just with the summary alone since it showed the tools used and the repeating process and why he kept doing it in one word "White"";s:4:"part";s:1:"1";s:4:"cond";s:1:"2";s:4:"step";s:6:"watch3";s:4:"from";s:21:"/labeler/vs-watch.php";s:4:"vid1";s:2:"22";s:4:"vid2";s:2:"23";s:4:"vid3";s:2:"29";}', '2012-09-18 02:12:03'),
(835, 'a:3:{s:8:"username";s:3:"P14";s:8:"is_admin";s:1:"0";s:3:"uid";s:2:"18";}', 'a:15:{s:15:"entry_0_0_group";s:1:"6";s:15:"entry_0_1_group";s:1:"6";s:15:"entry_0_2_group";s:1:"5";s:15:"entry_0_3_group";s:1:"6";s:15:"entry_0_4_group";s:1:"6";s:15:"entry_0_5_group";s:1:"6";s:15:"entry_0_6_group";s:1:"5";s:15:"entry_0_7_group";s:1:"6";s:15:"entry_0_8_group";s:1:"6";s:15:"entry_0_9_group";s:1:"7";s:7:"comment";s:520:"More details are delivered in this method. I could see what tools are used and its location on the menu more clearly and the narration was much added value as well because some important parts such as why or what author tries to do is actually spoken rather shown. Purpose of the video was also clear that I could choose which was the suitable tutorial for the job. Downside was the flow of the video and audio. Clipped videos sometimes sounded awkward as well as jumping screens. resulting not too enjoyable experience.";s:4:"part";s:1:"1";s:4:"cond";s:1:"2";s:4:"step";s:2:"pq";s:4:"from";s:34:"/labeler/vs-post-questionnaire.php";}', '2012-09-18 02:27:00'),
