(849, 'a:3:{s:8:"username";s:3:"P14";s:8:"is_admin";s:1:"0";s:3:"uid";s:2:"18";}', 'a:11:{s:15:"entry_0_0_group";s:1:"6";s:15:"entry_0_1_group";s:1:"5";s:15:"entry_0_2_group";s:1:"6";s:7:"comment";s:503:"In summary, I didn''t really get the whole process and what effect and corrections caused following screenshots and screenshots looked pretty similar so i wasn''t clear what filters actually did to it. Also just stating filter names were not enough to adjust the image to desirable state. In video, it shows what values should be used and how to  change the curve to get the effects wanted. after watching the whole clip, my confidence level increased as I understood what is going on between screenshots.";s:4:"part";s:1:"1";s:4:"cond";s:1:"3";s:4:"step";s:6:"watch2";s:4:"from";s:21:"/labeler/vs-watch.php";s:4:"vid1";s:2:"37";s:4:"vid2";s:2:"35";s:4:"vid3";s:2:"33";}', '2012-09-18 05:11:30'),
(850, 'a:3:{s:8:"username";s:3:"P14";s:8:"is_admin";s:1:"0";s:3:"uid";s:2:"18";}', 'a:11:{s:15:"entry_0_0_group";s:1:"7";s:15:"entry_0_1_group";s:1:"6";s:15:"entry_0_2_group";s:1:"6";s:7:"comment";s:296:"Half of this was about lomo and half was about recording the effect. In summary, i did not notice about the recording part yet thought whole thing was just giving the lomo effect. also the last picture was out of the blue in summary. I am more sure now that this actually is related to the task. ";s:4:"part";s:1:"1";s:4:"cond";s:1:"3";s:4:"step";s:6:"watch3";s:4:"from";s:21:"/labeler/vs-watch.php";s:4:"vid1";s:2:"37";s:4:"vid2";s:2:"35";s:4:"vid3";s:2:"33";}', '2012-09-18 05:24:50'),
(851, 'a:3:{s:8:"username";s:3:"P14";s:8:"is_admin";s:1:"0";s:3:"uid";s:2:"18";}', 'a:15:{s:15:"entry_0_0_group";s:1:"4";s:15:"entry_0_1_group";s:1:"1";s:15:"entry_0_2_group";s:1:"2";s:15:"entry_0_3_group";s:1:"2";s:15:"entry_0_4_group";s:1:"2";s:15:"entry_0_5_group";s:1:"4";s:15:"entry_0_6_group";s:1:"5";s:15:"entry_0_7_group";s:1:"5";s:15:"entry_0_8_group";s:1:"1";s:15:"entry_0_9_group";s:1:"3";s:7:"comment";s:681:"Strength would be the short time to catch what this tutorial is about and key words are shown in texts such as menu names and filter names. If I had more experience in photoshop and kinda acknowledged the terms, it would been real fast to generate lomo effect because i know what it does and how to adjust values. But without the experience, just showing effect names and screenshots after effects did not carry enough information what to do. Hard to remember effect names and sequences that need to be done. also thumbnails are small enough i can''t distinguish the difference in most cases. It might have been better for intermediate users with phosothop running right next to it.";s:4:"part";s:1:"1";s:4:"cond";s:1:"3";s:4:"step";s:2:"pq";s:4:"from";s:34:"/labeler/vs-post-questionnaire.php";}', '2012-09-18 05:35:06'),
