INSERT INTO `tasks` (`id`, `name`, `description`, `start_img`, `ex_before_img`, `ex_after_img`, `ex_video`, `added_at`) VALUES
(1, 'Motion Blur', 'Motion blur is the apparent streaking of rapidly moving objects in a still image or a sequence of images such as a movie or animation. <br>It results when the image being recorded changes during the recording of a single frame, either due to rapid movement or long exposure.', 'motion-blur.jpg', 'motion-blur-before.jpg', 'motion-blur-after.jpg', '', '2012-09-13 04:00:00'),
(2, 'Background Removal', 'This technique isolates background or an object from an image. <br>Photoshop offers a wide variety of tools for removing backgrounds.', 'bg-removal.jpg', 'bg-removal-before.jpg', 'bg-removal-after.jpg', '', '2012-09-13 04:00:00'),
(3, 'Lomo Effect', 'Lomography or Lomo style photos. <br>These photos typically feature unique coloring, high contrast, soft focus and dark vignettes. <br>The movement was started in the early nineties when the founders were inspired <br>by the images produced from cheap Russian toy cameras like the Lomo LC-A.', 'lomo.jpg', 'lomo-before.jpg', 'lomo-after.jpg', '', '2012-09-13 04:00:00'),
(4, 'Retro Effect', 'Retro effect makes a photo look dated or analog, <br>with color effects such as color washes, light leaks, and blurs. ', 'retro.jpg', 'retro-before.png', 'retro-after.png', '', '2012-09-13 04:00:00'),
(5, 'Photo to Sketch Effect', 'Convert a photo to look like a pencil-drawn sketch.', 'photo-sketch.jpg', 'photo-sketch-before.jpg', 'photo-sketch-after.jpg', '', '2012-09-13 04:00:00'),
(6, 'Teeth Whitening', 'Make teeth in a photo look whiter and brighter', 'teeth-whitening.jpg', 'teeth-whitening-before.jpg', 'teeth-whitening-after.jpg', '', '2012-09-13 05:21:44');
